const CONNECTIONI_URL = process.env.DB
const port = process.env.PORT || 5001
const conn=mongoose.connect(CONNECTIONI_URL, {
        useNewUrlParser: true,
        useUnifiedTopology: true,
    })
    .then(() => app.listen(port, () => console.log(`MongoDb conncted and listening successfully at port ${port}`)))
    .catch((error) => console.log(error.message))
let gfs
    const db=mongoose.connection
    db.once('oprn',()=>{
        gfs = Grid(db.db,mongoose.mongo)
        gfs.collection('uploads')
    })


    ////engines

    const storage = new GridFsStorage({
        url: 'mongodb://host:27017/database',
        file: (req, file) => {
          return new Promise((resolve, reject) => {
            crypto.randomBytes(16, (err, buf) => {
              if (err) {
                return reject(err);
              }
              const filename = buf.toString('hex') + path.extname(file.originalname);
              const fileInfo = {
                filename: filename,
                bucketName: 'uploads'
              };
              resolve(fileInfo);
            });
          });
        }
      });
      const upload = multer({ storage });
      app.post('/uploads',upload.single('doc'),(req,res)=>{
          
      })
app.use('/tenders', route)
app.use('/', userRoute)
